import React from 'react'

const Error = () => {
    return (
        <>
            <div className="error">
                <img src="../img/error.png" alt="error pic" width="400" height="00"/><br/>
                <h1 >Page Not Found</h1>
            </div>
        </>
    )
}

export default Error;
